CREATE TABLE "ATTENDANCE" 
   (	"ID" NUMBER, 
	"EMPLOYEE_ID" VARCHAR2(30 BYTE) NOT NULL ENABLE, 
	"PUNCHTIME" TIMESTAMP (6) NOT NULL ENABLE, 
	"DIRECTION" VARCHAR2(5 BYTE), 
	"JUSTIFICATION" VARCHAR2(200 BYTE), 
	 CONSTRAINT "ATTENDANCET_PK" PRIMARY KEY ("EMPLOYEE_ID", "PUNCHTIME")
    );


CREATE TABLE "ATTENDANCE_HEADER" 
   ("EMPLOYEE_ID" VARCHAR2(30 BYTE) NOT NULL, 
	"TRX_DATE" DATE, 
	"WORKING_HOURS" TIMESTAMP (6),
	"LEAVE_NAME" VARCHAR2(30),
	"HOLIDAY_NAME" VARCHAR2(60),
	 CONSTRAINT "ATTENDANCE_HEADER_PK" PRIMARY KEY ("EMPLOYEE_ID", "TRX_DATE")
    );	


SET DEFINE OFF;
	

	
	